import Styled from 'styled-components';
import '../index.css';
const NewsTicker = () => {
  return (
    <Wrapper>
    <BreakingBox>
    <BigHeader className="heading">Requiem 4 The Web</BigHeader>
      </BreakingBox>
    <NewsBox>
  <News className="textUpdate"> The world is evolving around our fingertips</News>
    </NewsBox>
    </Wrapper>

  )
}
