background:black;
height:10vh;
width:80vw;
border-bottom: 1.5px solid #f56468;

`;

const BigHeader = Styled.h1`

font-size:2.0vw;
color:#f56468;
text-align: center;
text-decoration-line: overline ;
 text-decoration-style: ;
    font-family: 'Big Shoulders Stencil Display', cursive;
`;

const News = Styled.p`
font-size: 1.5vw;
color:white;
position:center;
text-align: right;
padding: 25px;
`;
export default NewsTicker
